import React, { Component } from 'react';
import { Container }  from '@mui/material';
import { Link } from 'react-router-dom';
export default class Main extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      email: '',
      id: '',
    };
  }

}
